import React from "react";
import { Link } from 'react-router-dom';

import Container from "../Container";

import "../../styles/NavbarStyles/styles.css";

const Navbar = () => {
    return (
        <nav>
            <Link to="/">Home</Link>
        </nav>
    );
}

export default Navbar;
